import React, { Component } from "react";
import axios from "axios";
// import Products from "../DB/products.json";
// import { Headphones } from "./Headphones";

export default class Headphone extends Component {
  constructor(props) {
    super(props);
    this.state = { headphones: props.items };
  }
  state = {};
  componentDidMount = () => {
    this.getData();
  };
  getData() {
    axios.get("/headphones/Apple-AirPods", {}).then(res => {
      this.setState({ res });
    });
  }
  render() {
    return <div>{this.state.res}</div>;
  }
}

